const questions = [
  {
    question: "What is 5 × 3 equal to?",
    property: "Commutative Property",
    answers: ["15", "8", "12", "20"],
    correctAnswer: "15",
    explanation: "The commutative property states that changing the order of factors doesn't change the product."
  },
  {
    question: "If 4 × (2 × 3) = (4 × 2) × 3, which property is being demonstrated?",
    property: "Associative Property",
    answers: ["Commutative Property", "Associative Property", "Distributive Property", "Identity Property"],
    correctAnswer: "Associative Property",
    explanation: "The associative property states that the way factors are grouped doesn't change the product."
  },
  {
    question: "What is 6 × (4 + 2) equal to?",
    property: "Distributive Property",
    answers: ["36", "24", "30", "42"],
    correctAnswer: "36",
    explanation: "Using the distributive property: 6 × (4 + 2) = (6 × 4) + (6 × 2) = 24 + 12 = 36"
  },
  {
    question: "What is 7 × 1 equal to?",
    property: "Identity Property",
    answers: ["7", "1", "0", "8"],
    correctAnswer: "7",
    explanation: "The identity property states that any number multiplied by 1 equals itself."
  },
  {
    question: "What is 9 × 0 equal to?",
    property: "Zero Property",
    answers: ["0", "9", "1", "90"],
    correctAnswer: "0",
    explanation: "The zero property states that any number multiplied by 0 equals 0."
  },
  {
    question: "If 3 × 5 = 5 × 3, which property is being demonstrated?",
    property: "Commutative Property",
    answers: ["Associative Property", "Distributive Property", "Commutative Property", "Identity Property"],
    correctAnswer: "Commutative Property",
    explanation: "The commutative property states that changing the order of factors doesn't change the product."
  },
  {
    question: "What is (2 × 3) × 4 equal to?",
    property: "Associative Property",
    answers: ["24", "18", "20", "14"],
    correctAnswer: "24",
    explanation: "Using the associative property: (2 × 3) × 4 = 6 × 4 = 24"
  }
];

export default questions;
